"""## 1. DataTypes and attributes

**NOTE:** Important to remember the main type in NumPy is `ndarray`, even seemingly different kinds of arrays are still `ndarray`'s.

This means an operation you do on one array, will work on another.   
The whole NumPy library is based on one main object: ndarray (which stands for N-dimensional array). 
This object is a multidimensional homogeneous array with a predetermined number of items: 
homogeneous because virtually all the items within it are of the same type and the same size.

In fact, the 
data type is specified by another NumPy object called dtype (data-type);

each ndarray is associated with 
only one type of dtype.
The number of the dimensions and items in an array is defined by its shape, a tuple of N-positive 
integers that specifies the size for each dimension. The dimensions are defined as axes and the number of 
axes as rank
"""

# 1-dimensional array, also referred to as a vector

a1 = np.array([1, 2, 3])
a1

a2=np.array([1,2,3])
type(a2)

# 2-dimensional array, also referred to as matrix
